import React, { Component } from 'react';

const GameMap = (props) => {
  const flattenMap = [].concat(...props.map);
  const renderMap = flattenMap.map(cell => {
    let cellContent = props.win && cell.winnie ? "wonton" : cell.winnie ? "winnie flaticon-pug" : cell.tracked ? "paw flaticon-paw-print" : null;

    return <div className={`gameCell ${cellContent}` }onClick={props.winnieMove}> {cellContent === "wonton" ? <img src="./wonton.png" width="50px" /> : null}</div>
  })


  return (
    <div className="gameBoard">
      {renderMap}
    </div>
  )
}

export default GameMap;
